import React from 'react'; 
import Navbar from './components/Navbar'; 
import Footer from './components/Footer';

const App =  () => { 
    return ( 
        <div> 
            <Navbar />
            <h1 align="center">Dubiel Digital</h1>
            <h2 align="center">Full Software Project Builds From Scratch</h2> 
            <br /> 
            <Footer />
        </div>
    )
} 

export default App;
